%pig
business = LOAD 'hdfs://dumbo/user/ddp337/business.json' USING com.twitter.elephantbird.pig.load.JsonLoader('-nestedLoad') as (row:map[]);
review = LOAD 'hdfs://dumbo/user/ddp337/review.json' USING com.twitter.elephantbird.pig.load.JsonLoader('-nestedLoad') as (row:map[]);

%pig
business_required = FOREACH business generate FLATTEN(row#'categories') as categories,row#'business_id' AS business_id ,row#'city' AS city, row#'latitude' AS latitude, row#'longitude' AS longitude,ACOS(SIN(55.9469753*3.14159/180)*SIN((row#'latitude')*3.14159/180)+COS(55.9469753*3.14159/180)*COS((row#'latitude')*3.14159/180)*COS(-3.2096308*3.14159/180 - (row#'longitude')*3.14159/180))*6371 as distance;
business_required = FILTER business_required BY distance <=15;

review_required = FOREACH review GENERATE row#'business_id' AS business_id, (float)row#'stars' AS stars,row#'user_id' AS user_id;

%pig
business_plus_review = JOIN business_required BY business_id, review_required BY business_id;
business_plus_review_group = GROUP business_plus_review BY categories;
business_plus_review_group = FOREACH business_plus_review_group GENERATE FLATTEN(group) as categories,AVG(business_plus_review.stars) AS stars;
DUMP business_plus_review_group;
